export class Flashcard {
  id?: number;
  title: string = '';
  question: string = '';
  answer: string = '';

  constructor(id?: number, title: string = '', question: string = '', answer: string = '') {
      this.id = id;
      this.title = title;
      this.question = question;
      this.answer = answer;
  }
}
